import React, { Component } from "react";
import Header from "../../components/NutritionLabelComponents/Header/Header";
import Nutrients from "../../components/NutritionLabelComponents/Nutrients/Nutrients";
import Vitamins from "../../components/NutritionLabelComponents/Vitamins/Vitamins";
import Styles from "./NutritionLabel.module.css";

class NutritionLabel extends Component {
    state = {
        itemsList: [
            {
            nutrition:null,
            name: "Cheese",
            amount:{    
                amount:100,
                units:"grams"
                }
            },
            {
            nutrition:null,
            name: "Salt",
            amount:{   
                amount:2,
                units:["spoon","spoons"]
                }
            },
            {
            nutrition:{
                servingSize:"100g",
                servingsPerContainer:null,
                calories:144,
                totalFat:9.6,
                saturatedFat:3.2,
                transFat:0,
                cholesterol:372,
                sodium:142,
                totalCarbs:0.7,
                dietaryFiber:0,
                sugars:0.4,
                protein:12.6,
                vitaminA:10.8,
                vitaminC:0,
                calcium:4.4,
                iron: 9.8
            },
            name: "Egg",
            amount: {
                amount:1,
                units:null
                }
            }
        ]
    } 
    render(){
        return(
            <div>
                <Header servingSize="100 g"/>
                <Nutrients>
                    <ul>
                        <li>
                            <b className={Styles.Attribute}>Total Fat</b>
                            <ul>
                                <li>Saturated Fat {saturatedFat}g</li>
                                <li>Trans Fat {transFat}</li>
                            </ul>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Cholesterol</b> {cholesterol}mg
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Sodium</b> {sodium}mg
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Total Carbohydrates</b> {totalCarbs}g
                            <ul>
                                <li>Dietary Fiber {dietaryFiber}g</li>
                                <li>Sugars {sugars}g</li>
                            </ul>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Protein</b> {protein}g
                        </li>
                    </ul>
                </Nutrients>
                <Vitamins collection={[
                    [`Vitamin A ${vitaminA}%`, `Vitamin C ${vitaminC}%`],
                    [`Calcium ${calcium}%`, `Iron ${iron}%`]
                ]}/>
            </div>
        )
    }
}

export default NutritionLabel;
